import * as S from "./styles";

const Header = () => {
  return (
    <S.Header>
      <img src="/images/oda-logo.jpg" />
      <input

             type="search"

             name="search-form"

             id="search-form"

             className="search-input"


             placeholder="Search user"

         />

    </S.Header>
  );
};

export default Header;
